import React, { useState } from 'react'
import { Footer } from '../DashBoard/Footer'
import { useForm } from 'react-hook-form'
// import { toast } from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css';
import { ToastContainer, toast } from 'react-toastify'
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

export const AddModule = () => {
  var style = {
    width: "90px"
}
var style1 = {
    visibility: "visible; animation-delay: 0.1s; animation-name: fadeInUp;"
}
var style2 = {
    visibility: "visible; animation-delay: 0.5s; animation-name: zoomIn;"
}

var style3 = {
    visibility: "visible; animation-delay: 0.1s; animation-name: fadeInUp;"
}

var style4 = {
    height: "250px"
}

var style5 = {
    height: "250px"
}

var style6 = {
    height: "48px"
}

var style7= {
    visibility: "visible; animation-delay: 0.1s; animation-name: fadeIn"
}
 var style8={
    visibility: "visible; animation-delay: 0.3s; animation-name: fadeInUp"
 }
 const { register, handleSubmit } = useForm();
 var navigate = useNavigate()
 const [users, setusers] = useState()
 const Submit = (data) => {

  console.log(data)
  axios.post("http://localhost:5000/module/module", data).then((res) => {
      console.log(res)
      toast.success('ðŸ¦„ submit successfully', {
          position: "top-left",
          autoClose: 5000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
          theme: "light",
      });
      navigate("/detail:id")
      getApi()
  }).catch((err) => {
      console.log(err)
  })


};
const getApi = () => {

  axios.get("http://localhost:5000/module/module").then((res) => {

      console.log(res.data.module)
      setusers(res.data.module)

  }).catch((err) => {

      console.log(err)
  })


}
  return (
    <div class="container-xxl bg-white p-0">
       <ToastContainer
                position="top-left"
                autoClose={5000}
                hideProgressBar={false}
                newestOnTop={false}
                closeOnClick
                rtl={false}
                pauseOnFocusLoss
                draggable
                pauseOnHover
                theme="light"
            />
         
         
         
          <div class="container-xxl py-5 bg-primary hero-header mb-5">
                    <div class="container my-5 py-5 px-lg-5">
                        <div class="row g-5 py-5">
                            <div class="col-12 text-center">
                                <h1 class="text-white animated zoomIn">Add Module</h1>
                                <hr class="bg-white mx-auto mt-0" style={style} />
                                <nav aria-label="breadcrumb">
                                    <ol class="breadcrumb justify-content-center">
                                        <li class="breadcrumb-item"><a class="text-white" href="#">Home</a></li>
                                        <li class="breadcrumb-item"><a class="text-white" href="#">Pages</a></li>
                                        <li class="breadcrumb-item text-white active" aria-current="page">Add Module</li>
                                    </ol>
                                </nav>
                            </div>
                        </div>
                    </div>
                </div>


                <div class="container-xxl py-5">
                <div class="container px-lg-5">
                    <div class="row justify-content-center">
                        <div class="col-lg-7">
                            <div class="section-title position-relative text-center mb-5 pb-2 wow fadeInUp" data-wow-delay="0.1s" style={style1}>
                                <h6 class="position-relative d-inline text-primary ps-4">Welcome to AdminDashBoard Page</h6>
                                <h2 class="mt-2"> start the adventure</h2>
                            </div>
                            <div class="wow fadeInUp" data-wow-delay="0.3s" style={style8}>
                                <form onSubmit={handleSubmit(Submit)}>
                                    <div class="row g-3">
                                    <div class="col-md-12">
                                            <div class="form-floating">
                                                <input type="moduleName  " class="form-control" id="moduleName" placeholder="Your moduleName"  {...register("moduleName")} />
                                                <label for="tital">Your moduleName</label>
                                            </div>
                                        </div>

                                        <div class="col-md-12">
                                            <div class="form-floating">
                                                <input type="moduleName  " class="form-control" id="moduleName" placeholder="Your moduleName"  {...register("moduleName")} />
                                                <label for="timoduleNametal">Your moduleName</label>
                                            </div>
                                        </div>
                                        <div class="col-12">
                                            <div class="form-floating">
                                                <input type="description" class="form-control" id="description" placeholder="Your description" {...register("description")} />
                                                <label for="description"> Your description</label>
                                            </div>
                                        </div>
                                        
                                        <div class="col-12">
                                            <div class="form-floating">
                                                <input type="estimatedHours" class="form-control" id="estimatedHours" placeholder="Your estimatedHours" {...register("estimatedHours")} />
                                                <label for="estimatedHours"> Your estimatedHours</label>
                                            </div>
                                        </div>
                                        <div class="col-12">
                                            <div class="form-floating">
                                                <input type="status" class="form-control" id="status" placeholder="Your status" {...register("status.statusName")} />
                                                <label for="estimatedHours"> Your status</label>
                                            </div>
                                        </div>


                                        <div class="col-12">
                                            <button class="btn btn-primary w-100 py-3" type="submit">Submit</button>
                                        </div>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>


      <Footer/>
    </div>
  )
}
